import React from 'react';

const Navbar = () => {
  return (
    <section className="navbar-section p-6">
      <h2 className="text-2xl font-bold mb-4">Navbar Section</h2>
      <p>This is the Navbar component content.</p>
    </section>
  );
};

export default Navbar;
